[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?proteinLabel ?recommendedName
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:recommendedName ?recName .

  ?recName up:fullName ?recommendedName .

  FILTER(CONTAINS(LCASE(?recommendedName), "kinase"))

  OPTIONAL { ?protein rdfs:label ?proteinLabel }
}
LIMIT 100
"}}]

