[{"name": "mcp__pubmed__search_articles", "input": {"query": "human immunoglobulin glycosylation sites", "max_results": 20}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human immunoglobulin heavy chain", "limit": 10}}, {"name": "mcp__ols__searchClasses", "input": {"query": "immunoglobulin glycosylation", "pageSize": 10}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
